  const [visibleEvents, setVisibleEvents] = useState<any>(data[selectedType]);

  useEffect(() => {
    setVisibleEvents(data[selectedType]);
  }, [selectedType, data]);

  const handleRemoveEvent = (rangeIdx: number, eventId: number) => {
    const updatedEvents = visibleEvents.map((range: any, idx: number) => {
      if (idx === rangeIdx) {
        return {
          ...range,
          events: range.events.filter((event: any) => event.id !== eventId)
        };
      }
      return range;
    });

    setVisibleEvents(updatedEvents);
    setData({ ...data, [selectedType]: updatedEvents });
  };

  return (
    <div>
      {/* Event type switcher */}
      <div style={{ marginBottom: "20px" }}>
        <button onClick={() => setSelectedType("hyperglycemic")}>Hyperglycemic</button>
        <button onClick={() => setSelectedType("hypoglycemic")}>Hypoglycemic</button>
      </div>

      {/* Event ranges and events */}
      {visibleEvents.map((range: any, rangeIdx: number) => (
        <div key={rangeIdx} style={{ marginBottom: "15px" }}>
          <div>Range: {range.range[0]} - {range.range[1]}</div>
          <ul>
            {range.events.length > 0 ? (
              range.events.map((event: any) => (
                <li key={event.id} style={{ display: "flex", justifyContent: "space-between" }}>
                  <div>
                    {event.type}: {event.description} at {new Date(event.timestamp).toLocaleString()}
                  </div>
                  <button
                    style={{ marginLeft: "10px", cursor: "pointer" }}
                    onClick={() => handleRemoveEvent(rangeIdx, event.id)}
                  >
                    X
                  </button>
                </li>
              ))
            ) : (
              <li>No events</li>
            )}
          </ul>
        </div>
      ))}
    </div>
  );
};

